import { Icon } from '@iconify/react';

const Login_c = () => {
    return (
        <div className="w-full h-full flex flex-col items-center">
            <div className="logo p-2 border-b border-solid border-gray-400">
                <Icon icon="fluent-emoji-high-contrast:skull" width={100} />
            </div>

        </div>

    );
}

export default Login_c;
